import React, { useEffect, useState } from "react";
import { Camera, useCameraDevice } from "react-native-vision-camera";
import { Image, SafeAreaView, StyleSheet, Text, TouchableOpacity, View } from "react-native";
import Pdf from "react-native-pdf";
import Sound from "react-native-sound";
import Orientation from "react-native-orientation-locker";


const initialText = "接下来将展示免除保险人责任条款的书面说明，免除保险人责任条款非常重要，他与您有重大利害关系请您务必认真阅读，如果您在理解上还存在一些困难，可以要求销售人员再次说明。";
const sound_gif = require("./assets/sound.gif");
const mic_gif = require("./assets/mic.gif");


function PdfPageClaimerWithSign({ navigation }): React.JSX.Element {
  let device = useCameraDevice("front");
  let isActive = true;

  const [rightText, setRightText] = useState(initialText);
  const [rightGif, setRightGif] = useState(sound_gif);


  useEffect(() => {
    stage14();
    Camera.requestCameraPermission();
    Orientation.lockToLandscapeLeft();
  }, []);

  let s: Sound
  const stage14 = () => {
    const sound = new Sound(require("./assets/stage14.mp3"), (error) => {
      s = sound
      if (!error) {
        sound.play((success) => {
          sound.release();
          if (success) {
            console.log("音频14播放完成");
          }
        });
      }
    });
  };

  let source = { uri: "data:application/pdf;base64," };

  return (
    <SafeAreaView>
      <View style={{ marginTop: 0, height: "100%" }}>
        <View style={{ flexDirection: "row", alignItems: "stretch" }}>
          <View style={{ flex: 5 }}>
            <View style={{
              position: "absolute", // 绝对定位
              bottom: 0, // 定位到图片顶部
              left: 0, // 定位到图片左侧
              right: 0, // 定位到图片右侧
              height: "20%", // 高度为屏幕高度的5%
              backgroundColor: "rgba(128, 128, 128, 0.5)", // 灰色透明背景
              flexDirection: "row",
              justifyContent: "space-between",
              alignItems: "center",
              paddingHorizontal: 10,
              zIndex: 9999
            }}>
              <Text style={{
                color: "#FFFFFF",
                fontSize: 15
              }}>请客户亲自浏览免除保险人责任条款，并核对签名是否是您亲自签署。</Text>
              <View style={{ flexDirection: "row" }}>
                <TouchableOpacity style={styles.button1} onPress={() => navigation.navigate("PdfPageClaimerWithSign")}>
                  <Text style={styles.buttonText}>刷新</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.button2} onPress={() => {
                  if (s !== undefined) {
                    s.stop().release()
                  }
                  navigation.navigate("Final1")}}>
                  <Text style={styles.buttonText}>核对完毕</Text>
                </TouchableOpacity>
              </View>
            </View>
            <Pdf
              source={source}
              scale={2}
              onLoadComplete={(numberOfPages, filePath) => {
                console.log(`Number of pages: ${numberOfPages}`);
              }}
              onPageChanged={(page, numberOfPages) => {
                console.log(`Current page: ${page}`);
              }}
              onError={(error) => {
                console.log(error);
              }}
              onPressLink={(uri) => {
                console.log(`Link pressed: ${uri}`);
              }}
              style={styles.pdf} />
          </View>

          <View style={{ flex: 1, width: "100%", marginLeft: 10, marginRight: 5 }}>
            <View style={{ height: "25%", marginBottom: 5 }}>
              <Camera
                style={[StyleSheet.absoluteFill, { height: "100%" }]}
                device={device}
                isActive={isActive}
              />
            </View>
            <View style={{ height: "75%" }}>
              <View style={{ height: "100%", width: "140%" }}>
                <Image resizeMode={"stretch"} style={{ width: "100%", height: "100%" }} source={rightGif}></Image>
              </View>
            </View>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "flex-start",
    alignItems: "center",
    marginTop: 25
  },
  pdf: {
    flex: 1,
    width: "100%"
  },
  button1: {
    backgroundColor: "#367bd8",
    padding: 10,
    marginHorizontal: 5,
    borderRadius: 5
  },
  button2: {
    backgroundColor: "#ff361e",
    padding: 10,
    marginHorizontal: 5,
    borderRadius: 5
  },
  buttonText: {
    color: "#FFFFFF",
    fontSize: 15
  }
});

export default PdfPageClaimerWithSign;
